import React, { useState } from 'react';

const Registration = () => {
  const [formData, setFormData] = useState({
    name: '',
    phone: '',
    email: '',
    preference: '',
    reason: '',
  });

  const [errors, setErrors] = useState({});
  const [successMsg, setSuccessMsg] = useState('');

  const handleChange = (e) => {
    setFormData((prev) => ({ ...prev, [e.target.name]: e.target.value }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const newErrors = {};

    if (!formData.name.trim()) newErrors.name = 'Name is required';
    if (!/^\d{10}$/.test(formData.phone)) newErrors.phone = 'Enter a valid 10-digit number';
    if (!/\S+@\S+\.\S+/.test(formData.email)) newErrors.email = 'Enter a valid email';
    if (!formData.preference) newErrors.preference = 'Please enter your preference';
    if (!formData.reason) newErrors.reason = 'Tell us why you chose this';

    if (Object.keys(newErrors).length > 0) {
      setErrors(newErrors);
      return;
    }

    setSuccessMsg('Registration successful!');
    setFormData({
      name: '',
      phone: '',
      email: '',
      preference: '',
      reason: '',
    });
    setErrors({});
  };

  return (
    <div style={styles.container}>
      <form style={styles.form} onSubmit={handleSubmit}>
        <h2 style={styles.heading}>Event Registration</h2>

        <label style={styles.label}>Name</label>
        <input
          name="name"
          value={formData.name}
          onChange={handleChange}
          style={styles.input}
        />
        {errors.name && <p style={styles.error}>{errors.name}</p>}

        <label style={styles.label}>Phone</label>
        <input
          name="phone"
          value={formData.phone}
          onChange={handleChange}
          style={styles.input}
        />
        {errors.phone && <p style={styles.error}>{errors.phone}</p>}

        <label style={styles.label}>Email</label>
        <input
          name="email"
          value={formData.email}
          onChange={handleChange}
          style={styles.input}
        />
        {errors.email && <p style={styles.error}>{errors.email}</p>}

        <label style={styles.label}>1st Preference Event</label>
        <input
          name="preference"
          value={formData.preference}
          onChange={handleChange}
          style={styles.input}
        />
        {errors.preference && <p style={styles.error}>{errors.preference}</p>}

        <label style={styles.label}>Why this preference?</label>
        <textarea
          name="reason"
          value={formData.reason}
          onChange={handleChange}
          style={{ ...styles.input, height: '100px' }}
        />
        {errors.reason && <p style={styles.error}>{errors.reason}</p>}

        <button type="submit" style={styles.button}>Submit</button>
        {successMsg && <p style={styles.success}>{successMsg}</p>}
      </form>
    </div>
  );
};

const styles = {
  container: {
    minHeight: '100vh',
    background: '#f2f2f2',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    padding: '20px',
  },
  form: {
    background: '#fff',
    padding: '30px',
    borderRadius: '10px',
    width: '100%',
    maxWidth: '500px',
    boxShadow: '0 8px 16px rgba(0,0,0,0.1)',
  },
  heading: {
    textAlign: 'center',
    marginBottom: '20px',
    color: '#222',
  },
  label: {
    display: 'block',
    marginBottom: '6px',
    fontWeight: '600',
    marginTop: '15px',
  },
  input: {
    width: '100%',
    padding: '10px',
    borderRadius: '6px',
    border: '1px solid #ccc',
    fontSize: '1rem',
    marginBottom: '5px',
  },
  button: {
    marginTop: '20px',
    width: '100%',
    padding: '12px',
    background: '#facc15',
    border: 'none',
    borderRadius: '6px',
    color: '#222',
    fontWeight: 'bold',
    cursor: 'pointer',
  },
  error: {
    color: 'red',
    fontSize: '0.9rem',
    marginTop: '2px',
  },
  success: {
    color: 'green',
    textAlign: 'center',
    marginTop: '15px',
    fontWeight: '600',
  },
};

export default Registration;
